import React, { useState } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';

const Login = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [name, setName] = useState('');
  const [address, setAddress] = useState('');
  const [error, setError] = useState('');
  const [isRegistering, setIsRegistering] = useState(false);

  const handleLogin = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post(`${process.env.REACT_APP_API_URL}/auth/login`, {
        email,
        password,
      });
      localStorage.setItem('token', response.data.access_token);
      localStorage.setItem('role', response.data.user.role);
      if (response.data.user.role === 'USER') {
        window.location.href = '/stores';
      } else if (response.data.user.role === 'STORE_OWNER') {
        window.location.href = '/owner';
      } else if (response.data.user.role === 'ADMIN') {
        window.location.href = '/admin';
      }
    } catch (err) {
      setError(err.response?.data?.message || 'Invalid credentials');
    }
  };

  const handleRegister = async (e) => {
    e.preventDefault();
    try {
      await axios.post(`${process.env.REACT_APP_API_URL}/auth/register`, {
        name,
        email,
        address,
        password,
        role: 'USER',
      });
      setIsRegistering(false);
      setName('');
      setAddress('');
      setEmail('');
      setPassword('');
      alert('Registration successful! Please log in.');
    } catch (err) {
      setError(err.response?.data?.message || 'Failed to register');
    }
  };

  return (
    <div className="card p-4 shadow-sm">
      <h2 className="card-title">{isRegistering ? 'Register' : 'Login'}</h2>
      {error && <div className="alert alert-danger">{error}</div>}
      {isRegistering ? (
        <form onSubmit={handleRegister}>
          <div className="mb-3">
            <label htmlFor="name" className="form-label">Name (20-60 characters)</label>
            <input
              type="text"
              className="form-control"
              id="name"
              value={name}
              onChange={(e) => setName(e.target.value)}
              required
            />
          </div>
          <div className="mb-3">
            <label htmlFor="email" className="form-label">Email</label>
            <input
              type="email"
              className="form-control"
              id="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
          </div>
          <div className="mb-3">
            <label htmlFor="address" className="form-label">Address (max 400 characters)</label>
            <input
              type="text"
              className="form-control"
              id="address"
              value={address}
              onChange={(e) => setAddress(e.target.value)}
              required
            />
          </div>
          <div className="mb-3">
            <label htmlFor="password" className="form-label">Password (8-16 characters, 1 uppercase, 1 special)</label>
            <input
              type="password"
              className="form-control"
              id="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
          </div>
          <button type="submit" className="btn btn-primary">Register</button>
          <button
            type="button"
            className="btn btn-secondary ms-2"
            onClick={() => setIsRegistering(false)}
          >
            Back to Login
          </button>
        </form>
      ) : (
        <form onSubmit={handleLogin}>
          <div className="mb-3">
            <label htmlFor="email" className="form-label">Email</label>
            <input
              type="email"
              className="form-control"
              id="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
          </div>
          <div className="mb-3">
            <label htmlFor="password" className="form-label">Password</label>
            <input
              type="password"
              className="form-control"
              id="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
          </div>
          <button type="submit" className="btn btn-primary">Login</button>
          <button
            type="button"
            className="btn btn-secondary ms-2"
            onClick={() => setIsRegistering(true)}
          >
            Register
          </button>
        </form>
      )}
    </div>
  );
};

export default Login;
